import {Component} from 'react'
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super()
    this.state={
      name :"Dantuluri"
    } 
  }
  render (){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
           Hey {this.state.name}
          </p>
          <button 
          onClick={()=>{
            this.state.name ="Yeshu",
            console.log(this.state,"22")
          }}>Change Name</button>
        </header>
      </div>
    );
  }
}

export default App;
